import React from 'react';
import Card from './Card';

const CardList = ({ robots }) => {
	const cardComponent = robots.map((user, i) => {
		return <Card id={robots[i].id} name={robots[i].name} nickname={robots[i].name} motto={robots[i].motto}/>
	})
	return (
       <div>

	      <Card id={robots[1].id} name={robots[1].name} nickname={robots[1].name} motto={robots[1].motto}/>
	      <Card id={robots[2].id} name={robots[2].name} nickname={robots[2].name} motto={robots[2].motto}/>
	      <Card id={robots[3].id} name={robots[3].name} nickname={robots[3].name} motto={robots[3].motto}/>
	      <Card id={robots[4].id} name={robots[4].name} nickname={robots[4].name} motto={robots[4].motto}/>
	      <Card id={robots[5].id} name={robots[5].name} nickname={robots[5].name} motto={robots[5].motto}/>
	   </div>
	);
}

export default CardList;
